import React from 'react';
import { Rnd } from 'react-rnd';
import { createStyles, makeStyles, Theme } from '@material-ui/core/styles';

const useStyles = makeStyles((theme: Theme) =>
  createStyles({
    root: {
      display: 'flex',
      flexDdirection: 'row',
      height: '100vh',
    },
    box: {
      display: 'flex',
      flexDdirection: 'column',
      background: '#ccc',
      padding: '10px',
      boxSizing: 'border-box',
      position: 'relative',
      overflowY: 'hidden',
      resize: 'horizontal',
      height: '100vh',
      width: '100%',
    },
  })
);

export default function NoteList(props: any) {
  const classes = useStyles();

  return (
    <Rnd
      default={{
        x: 0,
        y: 0,
        width: 320,
        height: 200,
      }}
      disableDragging={true}
      enableResizing={{
        top: false,
        right: true,
        bottom: false,
        left: false,
        topRight: false,
        bottomRight: false,
        bottomLeft: false,
        topLeft: false,
      }}
    >
      <div className={classes.root}>
        <div className={classes.box}>
          <span>Contents</span>
        </div>
        <div
          onDrag={(e: any) => {
            console.log(e.clientX);
          }}
        ></div>
      </div>
    </Rnd>
  );
}
